// frontend/src/components/ForecastResult.js
import React from 'react';

/**
 * A naive function to guess sun probability based on
 * temperature (F), rain (mm), wind speed (km/h), and moisture.
 */
function calculateSunProbability(tempF, rainMm, windKm, moistureValue) {
  let sunProb = 100;

  // Rain significantly reduces sun probability
  // For example, if rain > 30 mm, big penalty
  if (rainMm > 50) {
    sunProb -= 70;
  } else if (rainMm > 20) {
    sunProb -= 50;
  } else if (rainMm > 5) {
    sunProb -= 30;
  } else if (rainMm > 0) {
    sunProb -= 15;
  }

  // Strong wind also decreases sun probability
  if (windKm > 40) {
    sunProb -= 20;
  } else if (windKm > 25) {
    sunProb -= 10;
  }

  // Low temperature can mean cloudy conditions or snow
  if (tempF < 32) {
    sunProb -= 15;
  } else if (tempF > 95) {
    // Very high temps might indicate less cloud cover
    sunProb += 5;
  }

  // High moisture can indicate more cloud coverage
  if (moistureValue > 15) {
    sunProb -= 15;
  } else if (moistureValue > 8) {
    sunProb -= 10;
  }

  // Clamp to [0, 100]
  if (sunProb < 0) sunProb = 0;
  if (sunProb > 100) sunProb = 100;

  return Math.round(sunProb);
}

function ForecastResult({ forecastData }) {
  if (!forecastData) {
    return (
      <div className="forecast-result">
        <h3>Forecast Overview</h3>
        <p style={{ color: '#777' }}>
          No forecast data yet. Select a location and click <strong>Submit</strong>.
        </p>
      </div>
    );
  }

  // Destructure the data coming from Flask
  const {
    lat,
    lon,
    day,
    temperature,  // Fahrenheit
    windSpeed,    // km/h
    moisture,     // dimensionless or %
    rain,         // mm
    customization,
    forecastDate, // original date string from user
  } = forecastData;

  // Deduce sun probability with a basic heuristic
  const sunProbability = calculateSunProbability(temperature, rain, windSpeed, moisture);

  return (
    <div className="forecast-result">
      <h3>Forecast Overview</h3>
      <div className="forecast-details">
        <img
          src="https://static.thenounproject.com/png/3271085-200.png"
          alt="Weather Icon"
          className="weather-icon"
        />
        <div>
          <p><strong>Coordinates:</strong> {lat.toFixed(5)}, {lon.toFixed(5)}</p>
          <p><strong>Day of Year:</strong> {day}</p>
          <p><strong>Temperature (D):</strong> {temperature?.toFixed(2)}</p>
          <p><strong>Rain (mm):</strong> {rain?.toFixed(2)}</p>
          <p><strong>Wind Speed (km/h):</strong> {windSpeed?.toFixed(2)}</p>
          <p><strong>Moisture:</strong> {moisture?.toFixed(2)}</p>

          {/* Calculated Sun Probability */}
          <p><strong>Sun Probability:</strong> {sunProbability}%</p>

          {customization && <p><strong>Customization:</strong> {customization}</p>}
          {forecastDate && <p><strong>Specific Date:</strong> {forecastDate}</p>}
        </div>
      </div>

      <div className="alert-section">
        <h3>Weather Alerts</h3>
        <p>No active alerts.</p>
      </div>
    </div>
  );
}

export default ForecastResult;
